import 'package:flutter/foundation.dart';import 'package:news/model/news_model.dart';class NewsListObject {  String status;  int totalResult;  List<News> articles;  NewsListObject({    required this.status,    required this.totalResult,    required this.articles  }) {    if(kDebugMode) {      print("Init NewsListObject");    }  }  factory NewsListObject.fromJson(Map<String, dynamic> json) {    return NewsListObject(        status: json["status"],        totalResult: json["totalResult"],        articles: json["articles"]);    }}